sys_variable_value.value:
(function execute(inputs, outputs) {
  var userDetails = {};
  userDetails['user_name'] = inputs.user_name;
  userDetails['translated_string'] = inputs.translated_sentence;
  userDetails['translated_language'] = inputs.translated_language;
  userDetails['flow_subflow_name'] = inputs.flow_subflow_name;
  userDetails['execution_count'] = inputs.execution_count;
  outputs.payload = JSON.stringify(userDetails);
})(inputs, outputs);

